import Home from './Home';
import { useEffect,useState } from 'react';
import axios from  'axios';
function App() {
  const [users,setUsers]=useState([]);
  useEffect(()=>{
    axios.get('http://localhost:3080/api').then(res=>{
      setUsers(res.data)
    }).catch(err=>{
      console.log(err);
    })
  },[])
  return (
    <div className="App">
      <Home />
    </div>
  );
}

export default App;
